import React, { Component } from 'react';
import Land1 from "../../assets/2 .jpg";
import Land2 from "../../assets/1.jpg";
import Land3 from "../../assets/3.jpg";
import "./maincompo.css";


class MainComp extends Component {

    render() {

        return (
            <React.Fragment>

                <div>
                    <p>We'd love to help</p>
                    <p>connect with us!</p>

                </div>








                <div className="card-group container">
                    <div className="card">
                        <img className="card-img-top" src={Land1} alt="Card image cap" />

                    </div>






                    <div className="card">
                        <img className="card-img-top" src={Land2} alt="Card image cap" />

                    </div>

                    <div className="card">
                        <img className="card-img-top" src={Land3} alt="Card image cap" />

                    </div>
                </div>









            </React.Fragment>




        );



    }




}
export default MainComp;
